import React from 'react';
import './App.css';
import Header from "./components/Header";
import Nav from "./components/Nav";


function App() {
  return (
      <div className='app-wrapper'>
        <Header />
         <Nav />
          <div className='content'>
              <img src='https://miro.medium.com/max/3840/1*U18aWqq2322t8Z26zZ0SIg.jpeg' />
              <div>
                  <img src='https://www.pngkit.com/png/full/400-4003726_free-png-hello-kitty-png-images-transparent-transparent.png' />
                  Description
              </div>
              <div>
                  My posts
                  <div>New post</div>
              </div>
              <div>
                  Posts
                  <div>post 1</div>
              </div>
          </div>
      </div>
  );
}

export default App;
